import React from "react"
import {useRouteMatch, Link} from "react-router-dom";


function BreadCrumb({studyDeck}){
  const trailOfBreadCrumbs = useRouteMatch();
  // console.log(trailOfBreadCrumbs)

  let result=""
  if(trailOfBreadCrumbs.path==="/decks/:deckId/study"){
    result=( 
      <>
        <li className="breadcrumb-item" aria-current="page"><Link to={"/"}>Home</Link></li>
        <li className="breadcrumb-item"><Link to={""}>{studyDeck.name}</Link></li>
        <li className="breadcrumb-item active" aria-current="page">Study</li>
      </>
    )
  }





  return(
    <nav aria-label="breadcrumb">
      <ol className="breadcrumb">
        {result}
      </ol>
    </nav>
  );
}

export default BreadCrumb;
